import './App.scss';

import { Routes } from "./routes/Routes";

import Navigation from './components/Navigation/Navigation';

function App() {
  return (
    <div className="container">
      <div className="body">
        <Navigation />
        <Routes />
      </div>
    </div>
  );
}

export default App;
